import sys
import os

if sys.argv[1]=='bashrc':
    if os.path.isfile('/tmp/status'): sys.exit()
    else: os.system('printf _kodi > /tmp/status')

if sys.argv[1]=='loop': os.system('printf menu > /tmp/status')

os.environ['DISPLAY'] = ':0'

if sys.argv[1]=='bashrc' or sys.argv[1]=='loop':

    from threading import Thread
    import subprocess
    os.system('clear')

    def cec_netflix(key):
        if key == 'up':
            os.system('eval $(xdotool getmouselocation --shell); if [ "$Y" -lt 50 ]; \
                      then xdotool key Up; else xdotool mousemove_relative -- 0 -20; fi')
        elif key == 'left': os.system('xdotool mousemove_relative -- -20 0')
        elif key == 'down':
            os.system('eval $(xdotool getmouselocation --shell); if [ "$Y" -gt 670 ]; \
                      then xdotool key Down; else xdotool mousemove_relative -- 0 20; fi')
        elif key == 'right': os.system('xdotool mousemove_relative -- 20 0')
        elif key == 'select': os.system('xdotool click 1')
        elif key == 'exit': os.system('killall -s 15 Xorg')
        elif key == 'pause': os.system('xdotool key space')
        elif key == 'play': os.system('xdotool key space')
        elif key == 'stop': os.system('xdotool key F5')
        elif key == 'rewind': os.system('xdotool key Left')
        elif key == 'Fast': os.system('xdotool key Right')

    def cec_retropie(key):
        if key=='exit':
            pid = os.popen('pidof /opt/retropie/emulators/retroarch/bin/retroarch').read().strip()
            if pid.isdigit(): os.system('kill -15 '+pid)
            else: os.system('killall -s 15 /opt/retropie/supplementary/emulationstation/emulationstation')

    def cec_menu(key):
        if key == 'left': os.system('xdotool key Shift+Tab')
        elif key == 'right': os.system('xdotool key Tab')
        elif key == 'select': os.system('xdotool key space')
        elif key == 'exit': os.system('printf exit > /tmp/status; killall -s 15 Xorg')

    def threaded_function():
        proc = subprocess.Popen(['cec-client'], stdout=subprocess.PIPE)
        while proc.poll() is None:
          line = str(proc.stdout.readline())
          program = open('/tmp/status').read()
          if 'pressed' in line and 'duration' in line:
              key = line.split('pressed: ')[1].split(' ')[0]
              if program=='menu': cec_menu(key)
              elif 'netflix' in program or program=='spotify' or program=='disney': cec_netflix(key)
              elif program=='retropie': cec_retropie(key)

    Thread(target = threaded_function).start()
    while True:
        program = open('/tmp/status').read()

        if program == 'exit': break
        else:
            os.system(f"{program[1:] if program[0] == '_' else f'startx /usr/bin/python3 /home/pi/menu.py {program} --'} > /dev/null 2>&1; {'' if program=='menu' else 'printf menu > /tmp/status'}")

    os.system('killall -s 15 cec-client')

elif sys.argv[1] == 'menu':

    from tkinter import *

    background_gif = ''
    kodi_gif = ''
    desktop_gif = ''
    netflix_italy_gif = ''
    netflix_usa_gif = ''
    retropie_gif = ''
    spotify_gif = ''
    disney_gif = ''

    os.system('xrandr -s 1280x720 -r 60')
    image_references = []

    def quit_(event):
        write_status('exit')

    def write_status(msg):
        os.system('printf ' + msg + ' > /tmp/status')
        root.destroy()

    def toggle_deluge(button):
        pid = os.popen('pidof /usr/bin/deluge-web -x').read().strip()
        if pid.isdigit():
            os.system('kill -s 15 '+ pid)
        else:
            os.system('deluge-web&')
        color = '#a00' if pid.isdigit() else '#0a0'
        button.configure(bg=color, highlightbackground=color)

    def new_button(frame, msg, pic):
        image_references.append(PhotoImage(data = pic))
        return Button(  frame,
                        text=msg,
                        command = lambda: write_status(msg),
                        image = image_references[-1],
                        width = 150, height = 100, bg='white',
                        highlightthickness=3
                     ).pack(padx=10, pady=10, side='left')

    root = Tk()
    #root.config(cursor='arrow')
    root.geometry('1281x721')
    root.bind('<Alt-F4>', quit_)

    background_image = PhotoImage(data = background_gif)
    background_label = Label(root, image=background_image)
    background_label.place(x=0, y=0, relwidth=1, relheight=1)

    frame = Frame(root, bg='white')
    frame.pack(side='bottom')

    color = '#0a0' if os.popen('pidof /usr/bin/deluge-web -x').read().strip().isdigit() else '#a00'

    deluge_button = Button(root, fg='white', text='WebTorrent', highlightthickness=5, bg=color, highlightbackground=color)
    deluge_button.place(x=1115, y=550)
    deluge_button.configure(command=lambda: toggle_deluge(deluge_button))

    new_button(frame, '_startx', desktop_gif)
    new_button(frame, '_kodi', kodi_gif)
    new_button(frame, 'netflix-usa', netflix_usa_gif)
    new_button(frame, 'netflix-italy', netflix_italy_gif)
    new_button(frame, 'disney', disney_gif)
    new_button(frame, 'spotify', spotify_gif)
    new_button(frame, '_emulationstation', retropie_gif)

    root.mainloop()


if sys.argv[1] in ' '.join(['spotify', 'netflix-italy', 'netflix-usa', 'disney']):

    open('/tmp/redirect.html', 'w').write('''
            <head>
                <script type="text/javascript">
                    setTimeout(function() { window.location="http://netflix.com"; }, 500);
                </script>
                <style type="text/css">
                    .loader {
                      position: absolute;
                      top: 50%; left: 50%; margin: -100px 0 0 -100px;
                      border: 16px solid #040204;
                      border-top: 16px solid #ff0000;
                      border-radius: 50%; width: 200px; height: 200px;
                      animation: spin 2s linear infinite;
                    }
                    @keyframes spin {
                      0% { transform: rotate(0deg); }
                      100% { transform: rotate(360deg); }
                    }
                </style>
            </head>
            <body style="background-color: #040204;"><div class="loader"></div></body>
    ''')

    user_agent = "'Mozilla/5.0 (X11; CrOS armv7l 11895.95.0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.125 Safari/537.36'"

    if 'spotify' in sys.argv[1]:   url = "https://open.spotify.com"
    elif 'netflix' in sys.argv[1]: url = f"--user-data-dir=/home/pi/.config/chromium-{sys.argv[1]} /tmp/redirect.html"
    elif 'disney' in sys.argv[1]:  url = "https://www.disneyplus.com/"

    os.system("xrandr -s 1280x720 -r 60")
    os.system('xdotool mousemove 640 360')
    os.system("compton &")
    os.system(f"chromium-browser --kiosk --noerrdialogs --disable-infobars --window-position=0,0 --window-size=1281,721 --user-agent={user_agent} {url}")

elif sys.argv[1] == '':
    pass

